import { useState } from "react";
import counterC from "./Counter.module.css"

function Counter(props) {
    let [count, setCount] = useState(0)
    function coun() {
        count++
        console.log(count);
    }

    return (
        <button onClick={coun} className={counterC.btn} >{count}</button>
    )
}

export default Counter
